import * as React from 'react';
import Button from '@mui/material/Button';
import { Box } from '@mui/material';
//import { useState , useEffect } from 'react';
import Paper from '@mui/material/Paper';
import { IconButton, Typography } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';




function Settings() {

  return (
    <Box  >
    <Button variant="contained" disableElevation sx={{ml:130 }} style={{backgroundColor:"orange" , color:"white"}}>
      أضف حصة
    </Button>
    <Paper  
  
  
    sx={{
      position:"relative",
      width:"340px",
      display:"flex",
      justifyContent:"space-between",
      mt:"1px",
      mb:"10px",
      pt:"15px",
      pb:"7px",
      //width: {xs:"340px",sm:"340px",md:"340px"},
      mr:{xs:"200px"},
      ml:{sm:"200px"}

  
    }}
   >

    <Typography sx={{ml:"16px" , fontSize:"1.3em"}} variant='h6'>title </Typography>

    <Typography
     sx={{
      mr:"33px", 
      fontSize:"1.4em",
      fontWeight:"500",
      opacity:"0.5",
      }} variant='h6'>الحصة الاولي  </Typography>

<IconButton 
      sx={{position:"absolute"  , right:"0"}}>
        <CloseIcon/>
      </IconButton>
    </Paper>
    </Box>
  )
}

export default Settings
